import React from "react";

import {Link} from "react-router-dom"


export const Navbar = () => {
    return <nav className="bg-dark-bckground sticky top-0 z-[20] mx-auto flex w-full items-center border-gray-500 p-8">
        <Link to="/">PersonaFitAI</Link>
        <ul>
            <li>
                <Link to="/login">Login</Link>
            </li>
        </ul>
    </nav>;
}
